import React from 'react';

import classes from './NavBar.module.css';

const NavBar = () => {
  return (
    <div className={classes.navBar}>
      <button>Home</button>
      <button>Shop</button>
      <header>Boutique</header>
      <button>Cart</button>
      <button>L</button>
    </div>
  );
};

export default NavBar;
